import React from "react";
import StudentNavBar from "./StudentNavBar";
import { Grid, Button } from "@mui/material";
// import { CloseIcon, DoneIcon } from "@mui/icons-material";
import DoneIcon from '@mui/icons-material/Done';

const PaperReview = () => {
  return (
    <>
      <StudentNavBar />
      <div
        style={{
          textAlign: "center",
          margin: "50px",
          fontWeight: "bold",
          display: "sticky",
        }}
      >
        2017 O Levels Science (Physics)
      </div>
      <div className="questions">
        <ol>
          <li style={{ marginBottom: "10px" }}>
            QUESTION
            <img src={"https://imgur.com/YIybWQ0"} alt="question 1" />
            <br />
            Your answer: C Correct answer: A <DoneIcon/>
          </li>
        </ol>
      </div>
      <Grid container justifyContent="center">
        <Button variant="outlined">Book Consultation</Button>
      </Grid>
    </>
  );
};

export default PaperReview;
